import React from 'react';
import { FaGithub, FaLinkedin } from 'react-icons/fa';

const Home = () => {
  return (
    <section className="bg-gray-900 text-white min-h-screen flex items-center justify-center px-6">
      <div className="max-w-6xl mx-auto flex flex-col md:flex-row items-center">
        {/* Left */}
        <div className="md:w-1/2 space-y-6 text-center md:text-left">
          <h1 className="text-4xl sm:text-5xl font-bold">
            I am Ayush Yadav
          </h1>
          <p className="text-xl text-gray-400">An aspiring Data Scientist</p>
          <div className="flex justify-center md:justify-start space-x-4">
            <a href="https://github.com/yourusername" target="_blank" rel="noreferrer">
              <FaGithub size={28} className="hover:text-pink-500" />
            </a>
            <a href="https://linkedin.com/in/yourusername" target="_blank" rel="noreferrer">
              <FaLinkedin size={28} className="hover:text-pink-500" />
            </a>
          </div>
        </div>

        {/* Right */}
        <div className="md:w-1/2 mt-10 md:mt-0 flex justify-center">
          <img
            src="/images/profile.png"
            alt="Ayush Yadav"
            className="rounded-full w-60 h-60 object-cover border-4 border-pink-500 shadow-lg"
          />
        </div>
      </div>
    </section>
  );
};

export default Home;
